INSERT INTO `products` (`id`, `productName`, `description`, `price`, `category`, `color`, `image`, `cart`, `size`) VALUES
(1, 'YIMI Puzzle', 'YIMI is a kind of cultural and creative brand, it comes from Jinlin, China. YIMI refers to five different kinds of rice: rice, red beans, mung beans, black rice, and millet. YIMI is a cultural creative brand, representing the characteristics of Jilin. This is YIMI puzzle. When the puzzle is put together you see YIMI illustrations in front of your eyes. Jigsaw puzzles are fun. Don\'t you want to try them yourself?', '11', 'YIMI Houseware', '', '../images/pintu.png', 0, 0),
(2, 'YIMI Breastpin', 'YIMI is a kind of cultural and creative brand, it comes from Jinlin, China. YIMI refers to five different kinds of rice: rice, red beans, mung beans, black rice, and millet. YIMI is a cultural creative brand, representing the characteristics of Jilin. This brooch can be worn with any of your clothes, and their patterns are YIMI characters and logos. If you like it, why not grab one? Sell four together.', '2', 'YIMI Clothes', '', '../images/xiongzhen.png', 0, 0),
(3, 'YIMI Cup', 'YIMI is a kind of cultural and creative brand, it comes from Jinlin, China. YIMI refers to five different kinds of rice: rice, red beans, mung beans, black rice, and millet. YIMI is a cultural creative brand, representing the characteristics of Jilin. This is YIMI cup, which shows the heads of a family of five. I\'m sure you\'ll like it.', '10', 'YIMI Souvenir', '', '../images/zhibei.png', 0, 0),
(4, 'YIMI X-Bag', 'YIMI is a kind of cultural and creative brand, it comes from Jinlin, China. YIMI refers to five different kinds of rice: rice, red beans, mung beans, black rice, and millet. YIMI is a cultural creative brand, representing the characteristics of Jilin. YIMIT shirts printed with little people are very cute. White is simple, clean and easy to match. I hope you like it.', '22', 'YIMI Houseware', '', '../images/baozhuangdai.png', 0, 0),
(10, 'A YIMI T-shirt', 'YIMI is a kind of cultural and creative brand, it comes from Jinlin, China. YIMI refers to five different kinds of rice: rice, red beans, mung beans, black rice, and millet. YIMI is a cultural creative brand, representing the characteristics of Jilin. This is YIMI packaging bag, and it\'s clean white. You can use it for other YIMI items. Hope you like it.', '24', 'YIMI Clothes', '', '../images/tshirt.png', 0, 0),
(11, 'YIMI Calendar', 'YIMI is a kind of cultural and creative brand, it comes from Jinlin, China. YIMI refers to five different kinds of rice: rice, red beans, mung beans, black rice, and millet. YIMI is a cultural creative brand, representing the characteristics of Jilin. This is YIMI desk calendar, which is covered with YIMI illustrations showing a family of five enjoying life together in their yard during harvest season. As the New Year begins, don\'t you want a new desk calendar?', '19', 'YIMI Souvenir', '', '../images/taili.png', 0, 0),
(12, 'YIMI Folder', 'YIMI is a kind of cultural and creative brand, it comes from Jinlin, China. YIMI refers to five different kinds of rice: rice, red beans, mung beans, black rice, and millet. YIMI is a cultural creative brand, representing the characteristics of Jilin. This is YIMI folder, and you can use it to organize your words. I believe when you close the folder and see the lovely YIMI illustrations, your mood will be very happy.', '14', 'YIMI Stationery', '', '../images/wenjianjia.png', 0, 0),
(5, 'YIMI Notebook', 'YIMI is a kind of cultural and creative brand, it comes from Jinlin, China. YIMI refers to five different kinds of rice: rice, red beans, mung beans, black rice, and millet. YIMI is a cultural creative brand, representing the characteristics of Jilin. This is my YIMI notebook, and my family is having dinner together. They got together in great fun and excitement.', '10', 'YIMI Stationery', '', '../images/benzi.png', 0, 0),
(6, 'YIMI Cards', 'YIMI is a kind of cultural and creative brand, it comes from Jinlin, China. YIMI refers to five different kinds of rice: rice, red beans, mung beans, black rice, and millet. YIMI is a cultural creative brand, representing the characteristics of Jilin. This is YIMI card, and you can think of it as a greeting card or as a hinge on which you can write something you want to say.', '5', 'YIMI Stationery', '', '../images/zheye.png', 0, 0),
(7, 'YIMI Postcard', 'YIMI is a kind of cultural and creative brand, it comes from Jinlin, China. YIMI refers to five different kinds of rice: rice, red beans, mung beans, black rice, and millet. YIMI is a cultural creative brand, representing the characteristics of Jilin. This is YIMI postcard and YIMI illustration. You can buy some warm words to send to your relatives and friends or buy collection.', '5', 'YIMI Stationery', '', '../images/mingxinpian.png', 0, 0),
(8, 'YIMI Tissue', 'YIMI is a kind of cultural and creative brand, it comes from Jinlin, China. YIMI refers to five different kinds of rice: rice, red beans, mung beans, black rice, and millet. YIMI is a cultural creative brand, representing the characteristics of Jilin. It\'s YIMI paper towels, and it\'s also small patterns of YIMI characters.', '2', 'YIMI Houseware', '', '../images/zhijin.png', 0, 0),
(9, 'YIMI Clock', 'YIMI is a kind of cultural and creative brand, it comes from Jinlin, China. YIMI refers to five different kinds of rice: rice, red beans, mung beans, black rice, and millet. YIMI is a cultural creative brand, representing the characteristics of Jilin. This is YIMI clock. It was black and white with a YIMI family illustration. Keep a clean clock in your room. Why not?', '25', 'YIMI Houseware', '', '../images/zhongbiao.png', 0, 0),
(128, 'YIMI Disk', 'This is YIMI Light Disk.', '15', '', '', '../images/guangpan.png', 0, 0);
